import { lazy } from "react";
import { authRoles } from "app/auth/authRoles";

const Interview = lazy(() => import("./Interview"));


const interviewRouter = [
    {
        path: "/interview/roles",
        component: Interview,
        auth: authRoles.admin
    },
    

];

export default interviewRouter;
